import './App.css';
import React from 'react';

class Professores extends React.Component
{
  render()
  {
    const profs = ['Arliones', 'Odilson'];
    console.log(profs.length);
    return (
      <div>
        <h1>Professores</h1>
        <ol>
          {profs.map((prof) => (
            <li>{prof}</li>
          ))}
        </ol>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <Professores/>
    </div>
  );
}

export default App;
